import styled from 'styled-components'
import { colors, fonts } from '../../utils/style/variables'

const Header = styled.h1`
    text-align: center;
    font-family: ${fonts.header};
`

function Home() {
    return (
        <div>

            <div className="home-wrapper">
            <Header><h1>COOK BOOK</h1></Header>
            </div>

        <p>Receipe</p>
        </div>
    );
  }

  export default Home;
